// --- Yield Prediction Logic ---
yieldForm.onsubmit = (e) => {
  e.preventDefault();
  const crop = document.getElementById('crop').value;
  const cropName = crop || "Multiple Crops";
  const yieldVal = (Math.random() * 10 + 1).toFixed(2);
  yieldOutput.innerHTML = `<p>📊 <strong>${cropName}</strong> yield: <strong>${yieldVal}</strong> tonnes/hectare</p>`;

  const imgs = cropImages[crop] || cropImages["default"];
  const randomImg = imgs[Math.floor(Math.random() * imgs.length)];
  yieldImage.innerHTML = `<img src="${randomImg}" alt="Crop Image">`;
};

// --- Crop Recommendation Logic ---
recommendForm.onsubmit = (e) => {
  e.preventDefault();
  const temp = parseFloat(document.getElementById('temperature').value);
  const hum = parseFloat(document.getElementById('humidity').value);
  const soil = document.getElementById('soil').value;

  const randomCrop = recommendations[Math.floor(Math.random() * recommendations.length)];
  const cropNameOnly = randomCrop.split(" ")[0];  // Get plain name

  recommendOutput.innerHTML = `<p class="recommendations">🌟 Based on your inputs, the recommended crop is: <strong>${randomCrop}</strong></p>`;

  const imgs = cropImages[cropNameOnly] || cropImages["default"];
  const randomImg = imgs[Math.floor(Math.random() * imgs.length)];
  recommendImage.innerHTML = `<img src="${randomImg}" alt="${cropNameOnly} Image">`;
};

// --- Tab Switch Logic ---
function switchTab(tabId) {
  document.querySelectorAll('.tab').forEach(tab => tab.classList.remove('active'));
  document.getElementById(tabId).classList.add('active');
}
